import React from 'react';
import Link from "src/components/shared/Link";

function ServiceItem(props) {
    {/*const serviceURL = `/service/${props.title.split(' ').join('-').toLowerCase()}?id=${props.id}`*/}
   
    return (
        <div className="col-sm-6 col-lg-4">
            <div className="service-item">
                <figure className="service-thumb">
                    <Link to={`${process.env.PUBLIC_URL + props.serviceURL}`}>
                        <img src={require('../../assets/img/' + props.thumb)} alt={props.title}/>
                    </Link>
                    <figcaption className="service-txt">
                        <h5>{props.title}</h5>
                    </figcaption>
                </figure>
                <div className="service-content">
                    <div className="service-content-inner">
                        <h5>
                            <Link to={`${process.env.PUBLIC_URL + props.serviceURL}`} className="stretched-link">{props.title}</Link>
                        </h5>
                        <p>{props.text}</p>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ServiceItem;
